import logo from './logo.svg';
import  Compteur  from './Clock';
import {Form} from './Form';
import './App.css';
import { Routes, Route, Link} from "react-router-dom";

function App() {
  return (
    <>
      <nav>
        <ul>
          <li>
            <Link to="/">From</Link>
          </li>
          <li>
            <Link to="/clocks">heure</Link>
          </li>
        </ul>
  </nav>
    <Routes>
    <Route path="/" element={<Form/>}/>
    <Route path="/clocks" element={<Compteur/>}/>
  </Routes>
    </>
  )
}

export default App;
